import React from 'react';
import { Link } from 'react-router-dom';
import { Github, Linkedin, Twitter, Instagram, Mail, Phone, MapPin } from 'lucide-react';
import { CLUB_INFO, DOMAINS } from '../../utils/constants';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const quickLinks = [
    { name: 'About Us', href: '/about' },
    { name: 'Projects', href: '/projects' },
    { name: 'Events', href: '/events' },
    { name: 'Achievements', href: '/achievements' },
    { name: 'Join Us', href: '/contact' }
  ];

  const socialLinks = [
    { name: 'GitHub', href: CLUB_INFO.social.github, icon: Github },
    { name: 'LinkedIn', href: CLUB_INFO.social.linkedin, icon: Linkedin },
    { name: 'Twitter', href: CLUB_INFO.social.twitter, icon: Twitter },
    { name: 'Instagram', href: CLUB_INFO.social.instagram, icon: Instagram }
  ];

  return (
    <footer className="bg-secondary-900 text-white">
      <div className="container-max section-padding">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {/* Club Info */}
          <div className="lg:col-span-2">
            <div className="flex items-center space-x-3 mb-4">
              <div className="w-10 h-10 bg-gradient-to-r from-primary-600 to-purple-600 rounded-lg flex items-center justify-center">
                <span className="text-white font-bold text-lg">M</span>
              </div>
              <div>
                <h3 className="text-xl font-bold">{CLUB_INFO.name}</h3>
                <p className="text-secondary-400 text-sm">{CLUB_INFO.fullName}</p>
              </div>
            </div>
            <p className="text-secondary-300 mb-6 max-w-md">
              {CLUB_INFO.description}
            </p>

            {/* Contact Info */}
            <div className="space-y-3">
              <div className="flex items-center space-x-3">
                <Mail size={16} className="text-primary-400" />
                <span className="text-secondary-300">{CLUB_INFO.email}</span>
              </div>
              <div className="flex items-center space-x-3">
                <Phone size={16} className="text-primary-400" />
                <span className="text-secondary-300">{CLUB_INFO.phone}</span>
              </div>
              <div className="flex items-center space-x-3">
                <MapPin size={16} className="text-primary-400" />
                <span className="text-secondary-300">{CLUB_INFO.address}</span>
              </div>
            </div>
          </div>

          {/* Quick Links */}
          <div>
            <h4 className="text-lg font-semibold mb-4">Quick Links</h4>
            <ul className="space-y-2">
              {quickLinks.map((link) => (
                <li key={link.name}>
                  <Link
                    to={link.href}
                    className="text-secondary-300 hover:text-primary-400 transition-colors duration-200"
                  >
                    {link.name}
                  </Link>
                </li>
              ))}
            </ul>
          </div>

          {/* Domains */}
          <div>
            <h4 className="text-lg font-semibold mb-4">Our Domains</h4>
            <ul className="space-y-2">
              {DOMAINS.map((domain) => (
                <li key={domain.id}>
                  <Link
                    to="/domains"
                    className="text-secondary-300 hover:text-primary-400 transition-colors duration-200 flex items-center space-x-2"
                  >
                    <span>{domain.icon}</span>
                    <span>{domain.name}</span>
                  </Link>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Bottom Section */}
        <div className="border-t border-secondary-800 mt-12 pt-8">
          <div className="flex flex-col md:flex-row justify-between items-center">
            <p className="text-secondary-400 text-sm mb-4 md:mb-0">
              Â© {currentYear} {CLUB_INFO.name}. All rights reserved.
            </p>

            {/* Social Links */}
            <div className="flex items-center space-x-4">
              {socialLinks.map((social) => {
                const Icon = social.icon;
                return (
                  <a
                    key={social.name}
                    href={social.href}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-secondary-400 hover:text-primary-400 transition-colors duration-200"
                    aria-label={social.name}
                  >
                    <Icon size={20} />
                  </a>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
